import React from 'react';
import { NavigationContainer, SwitchNavigator } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack';

import {
  HomeScreen,
  LoginScreen,
  RegisterScreen,
  ForgotPasswordScreen,
  Dashboard
} from './screens';

import UpdateUserInformation from './screens/UpdateUserInformation.js';
import CreateUpdateProfile from './screens/CreateUpdateProfile.js';
import global from './global.js';

const Stack = createStackNavigator();

global.Profile = {homePhone: '', workPhone: '', cellPhone: '', address: '', bio: '', hobbies: []};
global.User = '';
global.Token = '';

const AppStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        {global.Token === ''  && <Stack.Screen name = "Home" component={HomeScreen}/>}
        {global.Token !== ''  && <Stack.Screen name = "LoginScreen" component = {LoginScreen}/>}
        {global.Token === ''  && <Stack.Screen name = "RegisterScreen" component = {RegisterScreen}/>}
        {global.Token === ''  && <Stack.Screen name = "ForgotPasswordScreen" component = {ForgotPasswordScreen}/>}
        {global.Token !== ''  && <Stack.Screen name = "Dashboard" component = {Dashboard}/>}
        {/* <Stack.Screen name = "UpdateUserInformation" component = {UpdateUserInformation}/>
        <Stack.Screen name = "CreateUpdateProfile" component = {CreateUpdateProfile}/> */}
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default AppStack;
